import { Form } from "react-bootstrap";
import "./App.css";

const NewTask = () => {
  return (
    <Form className="container">
      <form className="wrapper">
        <div className="name">
          <label className="Name">Feladat neve</label>
        </div>
      </form>
    </Form>
  );
};

export default NewTask;
